import React from "react";
import "./Header.css";
import AccountBalanceIcon from "@mui/icons-material/AccountBalance";
const Header = () => {
  return (
    <div className="header">
      <div className="headerList">
        <div className="headerItem">
          <AccountBalanceIcon />
        </div>
      </div>
    </div>
  );
};

export default Header;
